import { defineMessages } from 'react-intl';

export const scope = 'app.components.ContactDetails';

export default defineMessages({
  paymentTerms: {
    id: `${scope}.paymentTerms`,
    defaultMessage: 'Payment Terms (Cash / Credit)',
  },
  discount: {
    id: `${scope}.discount`,
    defaultMessage: 'Discount (%)',
  },
  creditDays: {
    id: `${scope}.creditDays`,
    defaultMessage: 'Credit Days',
  },
  branchCode: {
    id: `${scope}.branchCode`,
    defaultMessage: 'Branch Code',
  },
  branchId: {
    id: `${scope}.branchId`,
    defaultMessage: 'Branch'
  },
  branchIdRequired: {
    id: `${scope}.branchIdRequired`,
    defaultMessage: 'Branch field is required.',
  },
  saleExecutiveCode: {
    id: `${scope}.saleExecutiveCode`,
    defaultMessage: 'Sales Executive Code',
  },
  paymentDetails: {
    id: `${scope}.paymentDetails`,
    defaultMessage: 'Payment Details',
  },
  mobileNumber: {
    id: `${scope}.mobileNumber`,
    defaultMessage: 'Mobile Number',
  },
  mobileNumberRequired: {
    id: `${scope}.mobileNumberRequired`,
    defaultMessage: 'Mobile Number field is required.',
  },
  mobileNumberInvalid: {
    id: `${scope}.mobileNumberInvalid`,
    defaultMessage: 'Enter a valid Mobile Number ',
  },
  alternateMobileNumber: {
    id: `${scope}.alternateMobileNumber`,
    defaultMessage: 'Alternate Mobile Number',
  },
  alternateMobileNumberRequired: {
    id: `${scope}.alternateMobileNumberRequired`,
    defaultMessage: 'Alternate Mobile Number field is required.',
  },
  emailAddress: {
    id: `${scope}.emailAddress`,
    defaultMessage: 'Email Address',
  },
  emailAddressRequired: {
    id: `${scope}.emailAddressRequired`,
    defaultMessage: 'Email Address field is required.',
  },
  invalidemailAddress: {
    id: `${scope}.invalidemailAddress`,
    defaultMessage: 'Email valid Email Address',
  },


  saveButtonLabel: {
    id: `${scope}.saveButtonLabel`,
    defaultMessage: 'Save & Next',
  },
  cancelButtonLabe: {
    id: `${scope}.cancelButtonLabe`,
    defaultMessage: 'Clear',
  },
  paymentDetailsSaveSuccess: {
    id: `${scope}.paymentDetailsSaveSuccess`,
    defaultMessage: 'Payment Details Save Successfully',
  },
  somethingWentWrong: {
    id: `${scope}.somethingWentWrong`,
    defaultMessage: 'Something Went Wrong!',
  },
});
